<!doctype html>

<html lang="en">
<head>
    <!-- scripts and style -->
    <style type="text/css">
        body {
            background: linear-gradient(248deg, #d92fc4, #6f2fd9, #2f76d9, #14d98d);
            background-size: 800% 800%;
            height:100%;
            width:100%;

            -webkit-animation: gradientScroll 10s ease infinite;
            -moz-animation: gradientScroll 10s ease infinite;
            animation: gradientScroll 10s ease infinite;
        }

        @-webkit-keyframes gradientScroll {
            0%{background-position:0% 50%}
            50%{background-position:100% 50%}
            100%{background-position:0% 50%}
        }
        @-moz-keyframes gradientScroll {
            0%{background-position:0% 50%}
            50%{background-position:100% 50%}
            100%{background-position:0% 50%}
        }
        @keyframes gradientScroll {
            0%{background-position:0% 50%}
            50%{background-position:100% 50%}
            100%{background-position:0% 50%}
        }
        
        .bigkitty {
            height: 30vw;
            position: absolute;
            left: 35vw;
            top: calc(50vh - 15vw);
            -webkit-animation: bounce 1s ease infinite;
            -moz-animation: bounce 1s ease infinite;
            animation: bounce 1s ease infinite;
        }
        @-webkit-keyframes bounce {
            0%, 100% {transform: translateY(0);} 
            40% {transform: translateY(-8vh);} 
            80% {transform: translateY(-8vh);} 
        } 
        @-moz-keyframes bounce {
            0%, 100% {transform: translateY(0);} 
            40% {transform: translateY(-8vh);} 
            80% {transform: translateY(-8vh);} 
        }
        @keyframes bounce {
            0%, 100% {transform: translateY(0);} 
            40% {transform: translateY(-8vh);} 
            80% {transform: translateY(-8vh);} 
        }
    </style>
</head>
